Layer.Datasource:

  (select way,sci_name, zoomview, nbdesc
  from points
  where sci_name='Root'
) as placenames
&datasource-settings;


  (select way,cladecenter,zoomview,sci_name, common_name, nbdesc
  from points
  where cladecenter is true
  order by nbdesc DESC
) as placenames
&datasource-settings;


  (select way,tip,zoomview,sci_name,common_name, nbdesc
  from points
  where cladecenter is null and tip is false
  order by nbdesc DESC
) as points
&datasource-settings;


  (select way,sci_name,common_name,tip,zoomview, nbdesc
  from points where tip is true
) as placenames
&datasource-settings;
